Dual Gear Drive - 146002Applications:
Ford 429 1968-73, 460 1968-97
Replace your timing chain with a PRW Dual Gear Drive Set. Unlike timing chains, gear drives will not stretch or wear prematurely under extreme conditions. Offset bushings allow for easy cam indexing and timing changes.nbsp;
nbsp;
Characteristics
Easy to install SAE 660 bronze thrust ring Rugged gear drives offer high-precision timing Available in noisy or quiet (for most applications) Dual idler gears for more stability than single gear drives Offset bushings for easy cam indexing (for most applications) Fits under most stock timing chain covers (occasional minor machining may be required)
